    apiKey: "AIzaSyDbLAoMJSmfJqEEXmirGedS-dMYTyqrIGs",
    authDomain: "ksiazki-app.firebaseapp.com",
    projectId: "ksiazki-app",
    storageBucket: "ksiazki-app.appspot.com",
